import Card from './Card';

export default function Cards(props) {
   const onClose = () => window.alert('Emulamos que se cierra la card');
   return <div>
      {props.characters.map(e =>(
         <Card 
         key={e.id}
         id={e.id}
         name={e.name}
         status={e.status}
         species={e.species}
         gender={e.gender}
         origin={e.origin.name}
         image={e.image}
         onClose={onClose}
         />
      )
         )}
   </div>;
}
